import {computed, makeObservable, observable} from 'mobx';

class Store {
  value = 1;
  constructor() {
    makeObservable(this, {
      value: observable,
      sum: computed
    })
  }
  sum = () => {
    console.log(this.value)
    return this.value++
  }
  why = () => {
    return console.log(this.value)
  }
}

export default new Store()
